This happens low enough that this does not interfere with gradients and other transformation passes but high enough that we can make use of the kernel cache.
The generated FunctionDef is templated by leveraging `AttrValue.signature` so we do not need to rebuild it for different attribute values.
Attempting to wrap an op with private attrs or variadic inputs/outputs will raise an error.
This experiment can be enabled by calling `context.enable_run_eager_op_as_function()`.

